import React from 'react';


class Stable extends React.Component {
    gettingSoldiers = async () => {
        const api_url = await
        fetch("api.openweathermap.org/data/2.5/weather?q=London");
        const dataa = await api_url;
        console.log(dataa);
    }

    render() {
        return (
            <div>
                <button onClick={this.gettingSoldiers}>click</button>
            </div>
        )
    }
}

export default Stable;
